import React from "react";
import arr from "./all/50.mp4";
import "./App.css";
import ReactPlayer from "react-player";

const App = () => {

  return <ReactPlayer width="20%" height="20%" url={arr} loop muted playing></ReactPlayer>;
};

export default App;
